import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">

      <div class="container border_color" style={{width:'100%',height:'100%'}}>
        <div class="row align-items-center">
          <div class="col-md-6">
            <div style={{width:'100%'}} class="border_color">
              <button type="button" class="btn btn-outline-primary">Scanner QR</button>
            </div>
          </div>
          <div class="col-md-6 align-items-center">
            <div style={{width:'100%',height:'500px'}}>
              <button type="button" class="btn btn-outline-success">Consultas</button>
            </div>

          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
